import React from 'react';
import './RecValue.css';
import { Table } from 'antd';

const columns = [{
    title: 'Ingredients',
    dataIndex: 'ingr',
    width: 150,
  }, {
    title: 'Value',
    dataIndex: 'value',
    width: 150,
  }];
  
  const data = [];
  for (let i = 0; i < 100; i++) {
    data.push({
      key: i,
      ingr: `${item.name}`,
      value: `${item.value}`

    });
  }
  
  export default RecValue;
  ReactDOM.render(
    <Table columns={columns} dataSource={data} pagination={{ pageSize: 50 }} scroll={{ y: 240 }} />,
    mountNode
  );

















